clearfkTrajectory = null;
setfkTrajectory = null;
function fakeFollowTrajectory(num,index,maxIndex){
    // console.log ("@ fakeFollowTrajectory("+num+","+index+","+maxIndex+")")
    fkTrajectory = setTimeout(function(){  
        robotInfo.Pose.Position.X = unconvertedPath.Trajectory[index].End.X;
        robotInfo.Pose.Position.Y = unconvertedPath.Trajectory[index].End.Y;
        robotInfo.State = 16;
        if (index >= maxIndex) {
            robotInfo.State = 8;
            statusPath = "Arrival to Poi: " + nearestPoiName;
            ihm.displayTrajectoryStatus(statusPath)
            console.log (statusPath);
            path = null;
        }
        // console.log(robotInfo)
        if(num > 0) {
            index = index+1;
            fakeFollowTrajectory(num - 1,index,maxIndex);
        }
    }, 100);
}

function stopFakeFollowTrajectory() {
    clearInterval(setfkTrajectory);
    robotInfo.statusPath = "STOP ORDER !!"
}



